import React from "react";
import ReactDOM from "react-dom";
import { Chart, registerables } from "chart.js";
import App from "./App";

// Register Chart.js components globally
Chart.register(...registerables);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
